import * as React from 'react';
import Box from '@mui/material/Box';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';
import ListSubheader from '@mui/material/ListSubheader';



export default function BasicSelect() {
  const [selected, setSelected] = React.useState('');

  const handleChange = (event) => {
    setSelected(event.target.value);
  };
  const options = [];
  for (var i = 1; i <= 30; i++) {
    options.push(
      <MenuItem value={i}>{`Geraet ${i}`}</MenuItem>
    );
  }
  const options1 = [];
  for (var i = 31; i <= 56; i++) {
    options1.push(
      <MenuItem value={i}>{`Geraet ${i}`}</MenuItem>
    );
  }

  return (
     <div>
      <div className="DropDownListContainer">
    <Box className="DropDownList" sx={{ minWidth: 200, maxWidth:200}}>

      <FormControl fullWidth>
        <InputLabel id="demo-simple-select-label">Gerätegruppen</InputLabel>
        <Select
          labelId="demo-simple-select-label"
          id="demo-simple-select"
          value={selected}
          label="Gerät"
          onChange={handleChange}
        >
           <ListSubheader>Category 1</ListSubheader>
          {options }
          <ListSubheader>Category 2</ListSubheader>
          {options1}

        </Select>
      </FormControl>

    </Box>
    </div>
    {/* {getPowerConsumption(selected)}
            {getAvrgPowerConsumption(selected)}
            {getMaxPowerConsumption(selected)}
            {getChartData(selected)} */}
    </div>
  );
}
